import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function AllTreks(){
    return (
        <div className="container my-4">
          <div className="row" style={{ border: "2px solid #ff0000", padding: "10px", borderRadius: "10px",width:"40%"}}>
            <div className="col-md-4" style={{ border: "2px solid #ff0000", padding: "10px", borderRadius: "10px"}}>
              <img src="trek-image.jpg" alt="Trek Image" className="img-fluid" />
            </div>
            <div className="col-md-6">
              <h2>Raigad Trek</h2>
              <p>Location: Mahad</p>
              <p>Duration: 7 days</p>
              <p>Approx: 37Km</p>
              <p>Grade: Moderate</p>
              <p>Altitude: 12100Ft.</p>
              <a href="book-trek.html" className="btn btn-primary">View Details</a>
            </div>
          </div>
        </div>
    );
}

export default AllTreks;
